#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>
#include <string.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < sizeof(enum http_status)) {
    return 0;
  }

  enum http_status status;
  memcpy(&status, data, sizeof(status));

  if (status >= HTTP_STATUS_CONTINUE && status <= HTTP_STATUS_HTTP_VERSION_NOT_SUPPORTED) {
    const char *status_str = http_status_str(status);
  }

  return 0;
}

#include "http_parser.h"
#include <stdint.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < 1) {
    return 0;
  }

  /* http_status is essentially an enum,
   * casting an arbitrary byte to it could basically cover all possible values.
   */
  enum http_status status = (enum http_status)(*data);

  /* Call the target function */
  http_status_str(status);

  return 0;
}
